import React from 'react';
import styles from './Settings.module.css';
import ActionButton from '../../ui/button/Button'; // This is the new or adapted button component for actions

const Settings = () => {
    // Example action handlers
    const handleClearCache = () => console.log('Clear cache');
    const handleChangeTheme = () => console.log('Change theme');
    const handleGetAuthorization = () => console.log('Get authorization');

    return (
        <section className={styles.settingsSection}>
            <table className={styles.settingsTable}>
                <tbody>
                    <tr>
                        <td>
                            <label htmlFor="clearCache" className={styles.label}>Cache</label>
                        </td>
                        <td>
                            {/* Assuming these buttons now perform an action rather than navigate */}
                            <Button onClick={handleClearCache}>Clear Cache</Button>
                        </td>
                    </tr>
                    <tr>
                        <td>
                            <label htmlFor="themeSwap" className={styles.label}>Theme</label>
                        </td>
                        <td>
                            <Button onClick={handleChangeTheme}>Change Theme</Button>
                        </td>
                    </tr>
                    <tr>
                        <td>
                            <label htmlFor="getAuth" className={styles.label}>Auth</label>
                        </td>
                        <td>
                            <Button onClick={handleGetAuthorization}>Get Authorization</Button>
                        </td>
                    </tr>
                </tbody>
            </table>
        </section>
    );
};

export default Settings;
